import React from "react";

function Footer() {
  return (
    <>
      <footer>
        <div className="container mx-auto py-28 px-10 sm:pl-0 md:pl-80 lg:md:pl-80">
          <div className="w-full h-px bg-gray-800">jjj</div>
        </div>
      </footer>
    </>
  );
}

export default Footer;
